const Prodcard = () => {
    const data = [
      { id: 1, name: "John Doe", key:"a" },
      { id: 2, name: "Victor Wayne", key:"b" },
      { id: 3, name: "Jane Doe" ,key:"a" }
    ];

    return (
      <div className="users">
        {data.map((data) => (
          <div className="user p-5 m-5 bg-primary">{data.name}{data.description}{data.price}{data.sale}{data.quantity}</div>
        ))}
      </div>
    );
  };

export default Prodcard
